import "./App.css";
import Main from "./screens/Main/Main";
import Layout from "./components/Layout/Layout";
import { BrowserRouter as Router,Routes, Route, Link } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Layout>
        <Routes>
          <Route path="/">
            <Main />
          </Route>
        </Routes>
      </Layout>
    </div>
  );
}

export default App;
